import React, { useState } from 'react';
import { toast } from 'react-hot-toast';

const CreateWishlist = () => {
  const [userId, setUserId] = useState('');
  const [menuItemId, setMenuItemId] = useState('');
  const [wishlist, setWishlist] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();
  
    try {
      const response = await fetch(`https://localhost:7027/api/wishlist?userId=${userId}&menuItemId=${menuItemId}`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({}), // Add an empty body since query parameters are used
      });
  
      if (!response.ok) {
        const errorMessage = await response.text();
        throw new Error(errorMessage || 'Failed to create wishlist');
      }
  
      const data = await response.json();
      setWishlist(data);
      toast.success('Wishlist created successfully');
    } catch (error) {
      console.error('Error creating wishlist:', error);
      toast.error('Failed to create wishlist. Please try again.');
    }
  };  
  return (
    <div>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          placeholder="User ID"
          value={userId}
          onChange={(e) => setUserId(e.target.value)}
        />
        <input
          type="number"
          placeholder="Menu Item ID"
          value={menuItemId}
          onChange={(e) => setMenuItemId(e.target.value)}
        />
        <button type="submit">Create Wishlist</button>
      </form>

      {wishlist && (
        <div>
          <h2>Wishlist Created Successfully</h2>
          <p>User ID: {wishlist.userId}</p>
          <p>Menu Item ID: {wishlist.menuItems[0].id}</p>
          <p>Menu Item Name: {wishlist.menuItems[0].name}</p>
          {/* Render other wishlist details here */}
        </div>
      )}
    </div>
  );
};

export default CreateWishlist;
